import { createApp } from 'vue'
import App from './App.vue'
import router from './router';
// main.js
import '@fullcalendar/core/main.css';
import '@fullcalendar/daygrid/main.css';
import '@fullcalendar/timegrid/main.css';

createApp(App)
.use(router)
.mount('#app');
